import logo from './logo.svg';
import './App.css';
import DragNDrop from './DragNDrop';
import React, {useEffect, useState} from 'react';

function App() {

  const data = [
    {title: 'group 1', items: ['1', '2', '3']},
    {title: 'group 2', items: ['4', '5']}
  ]

  return (
    <div className="App">
      <DragNDrop data={data}/>
    </div>
  );
}

export default App;
